import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Home from './Home';
import Search from './Search';

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/search" element={<Search />} />
            </Routes>
            <nav style={{ position: 'fixed', bottom: '10px', width: '100%', textAlign: 'center' }}>
                <Link to="/search">
                    <button
                        style={{
                            padding: '10px 20px',
                            fontSize: '16px',
                            backgroundColor: '#007BFF',
                            color: 'white',
                            border: 'none',
                            borderRadius: '5px',
                            cursor: 'pointer',
                        }}
                    >
                        Go to Search Page
                    </button>
                </Link>
            </nav>
        </BrowserRouter>
    );
}

export default App;
